(7, 80, 'Simulador de Sistema Operativo y Lenguaje Ensamblador', 'simulador-de-sistema-operativo-y-lenguaje-ensamblador', '<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambin el software que permite traducir cdigo fuente escrito en ensamblador a cdigo de mquina del simulador.</p>\r\n', '\r\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambin el software que permite traducir cdigo fuente escrito en ensamblador a cdigo de mquina del simulador; adems de otras herramientas de programacin de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y mdulos para generar ejecutables a partir del lenguaje ensamblador, un mdulo para manejo de procesos, mdulo para manejo de memoria y una seccin para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambin se puede emplear para hacer prcticas para ayudar en la comprensin de la arquitectura de las computadoras, el manejo de lenguaje mquina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gestin.</p>\r\n<p>{gallery}Articulo_3_Ayala{/gallery}</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/Articulo_3_Ayala/IJCTT-V51P109.pdf{/aridoc}</p>\r\n<p></p>', 1, 9, '2020-03-04 23:35:11', 135, '', '2020-04-09 21:05:32', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:35:11', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulo_introduccion\\/Collage 2020-03-13 01_49_44.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"