(8, 81, 'Laboratorio de Interconexin Inalmbrica', 'laboratorio-de-interconexion-inalambrica', '<p>Se disen un laboratorio para representar un ambiente de interconexion movil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y camaras de video vigilancia.</p>\r\n', '\r\n<p>Se disen un laboratorio para representar un ambiente de interconexion movil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y camaras de video vigilancia. Este entorno se utiliza para la realizacin de practicas y proyectos para las materias de computacion impartidas en la Facultad de Matematicas. El sistema permite analizar el proceso de la comunicacion, los protocolos de red y sus caracteristicas, esto como tema de estudio de los modelos OSI y TCP/IP. Tambin, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.</p>\r\n<p>{gallery}Articulo_9_Cervera{/gallery}</p>\r\n<h4>Manual de Utilizacin</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/Articulo_9_Cervera/Modelo_Didactico_manual_Laboratorio_de_interconexion.pdf{/aridoc}</p>', 1, 12, '2020-03-04 23:39:00', 135, '', '2020-03-21 01:45:46', 136, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:00', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.32.23.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"