(9, 82, 'Uno Aritmtico ', 'uno-aritmetico', '<p>Se adapto el juego de mesa UNO a una aplicacion movil que implementa lasoperaciones aritmeticas basicas y fomenta asi el pensamiento aritmetico.</p>\r\n', '\r\n<p>Desarrolla en los ninos habilidades para manejar las cuatro operaciones aritmeticas basicas y fomentar asi el pensamiento aritmetico. El contenido matematico que tiene esta adaptacion consiste en las propiedades de los numeros reales. Se adapto el juego de mesa UNO a una aplicacion movil para el dispositivo Samsung Galaxy Tab de 10 pulgadas, sin embargo, se modifico para ser ejecutado en otros dispositivos como los smartphones, con diversas capacidades de procesamiento y diferentes tamanos de pantallas. Se puede jugar en modalidad de un jugador, dos y hasta cuatro jugadores.</p>\r\n<p>{gallery}Articulo_4_Basto_Uno{/gallery}</p>\r\n<h4>Manual de Usuario Uno Aritmtico</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/Articulo_4_Basto_Uno/Manual_Usuario_Uno_Aritmetico.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-03-04 23:39:46', 135, '', '2020-04-09 17:56:45', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:46', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.01.43.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",