(36, 117, 'Juego Matemtico de la Cultura Maya: MATYA', 'juego-maya-matya', '<p style=\"text-align: justify;\">Diseo e Implementacin de un videojuego didctico que apoya a estudiantes de primaria reforzando el estudio de la nocin de fraccin. Los escenarios son creados por herramientas de modelado en 2D, 3D.</p>\r\n', '\r\n<p style=\"text-align: justify;\">Diseo e Implementacin de un videojuego didctico conformado de varias actividades, con el propsito de que los estudiantes de primaria, en especial los educandos de sexto grado, refuercen el estudio de la nocin de fraccin. Este juego es creado considerando un avatar, cuya accin de movimiento para el usuario es en tercera persona. Los escenarios son creados por herramientas de modelado en 2D, 3D y exportado a un formato que entienda el motor de juegos XNA.</p>\r\n<p>{gallery}Articulo_8_MaderaBastoMATYA{/gallery}<video controls=\"controls\" width=\"100%\" height=\"100%\">\r\n  <source src=\"videos/videojuegoMusic.mp4\" type=\"video/mp4\" />\r\nYour browser does not support the video tag.</video></p>', 1, 10, '2020-04-03 12:56:44', 136, '', '2020-04-09 19:07:38', 135, 0, '0000-00-00 00:00:00', '2020-04-03 12:56:44', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulo_introduccion\\/BeFunky-collage.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_d