(37, 118, 'Adivina al Geometronix', 'adivina-quien-de-geometria', '<p>El clsico juego de Adivina Quin!,peroahora enfocado a la Geometra</p>\r\n', '\r\n<p>Este ejemplo deAprendizaje Interactivo Multiusuario, se implement el uso de aplicaciones mviles como recursos alternativos para el aprendizaje de nociones matemticas en el Nivel Bsico.</p>\r\n<p>{gallery}Articulo_5_BastoGeometronix{/gallery}</p>\r\n<h4>Manual de Usuario \"Adivina al Geomtronix\"</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/Articulo_5_BastoGeometronix/Manual_Usuario-AdivinaAlGeometronix.pdf{/aridoc}</p>\r\n<p></p>', 1, 10, '2020-04-03 12:56:44', 136, '', '2020-04-09 19:04:24', 135, 0, '0000-00-00 00:00:00', '2020-04-03 12:56:44', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/Articulo_5_BastoGeometronix\\/2menu_principal.PNG\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"