(63, 5, 1, '', '2020-03-13 05:09:37', 136, 3001, 'db1a59be37976993cd7eda7078b745b864f58e94', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Librer\\u00eda con realidad aumentada\",\"alias\":\"libreria-con-realidad-aumentada\",\"introtext\":\"<p>Con una colecci\\u00f3n de m\\u00e1s de 48,568 vol\\u00famenes en la biblioteca de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n, la tarea de buscar un libro puede requerir mucho tiempo y ser muy frustrante, especialmente para los alumnos que est\\u00e1n conociendo apenas las instalaciones. El sistema desarrollado implementa una aplicaci\\u00f3n basada en Realidad Aumentada (AR) que tiene como objetivo resolver el desconocimiento espacial de los usuarios en la biblioteca, al brindarnos un sistema de b\\u00fasqueda en estanter\\u00edas mediante Realidad Aumentada. Esta aplicaci\\u00f3n ayuda a los estudiantes y a los usuarios en general, al proporcionar una gu\\u00eda m\\u00f3vil con los servicios de informaci\\u00f3n de la biblioteca. En el art\\u00edculo escrito por el autor del sistema, se presentan los resultados de un estudio piloto que demuestran que las experiencias y el rendimiento del usuario en la biblioteca se mejoraron mediante el uso de tecnolog\\u00eda de realidad aumentada.<\\/p>\\r\\n<p>{gallery}Articulo_1_Cevera_Uribe{\\/gallery}<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2020-02-07 07:28:28\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 05:09:37\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 05:07:53\",\"publish_up\":\"2020-02-07 07:28:28\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/Articulo_1_Cevera_Uribe\\\\\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"ima