(103, 5, 1, '', '2020-03-13 10:21:02', 136, 3648, '60eda062a8a775151b7717b671f29f933f28f98f', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Librer\\u00eda con realidad aumentada\",\"alias\":\"libreria-con-realidad-aumentada\",\"introtext\":\"<p style=\\\"text-align: justify;\\\">\\u00a0<\\/p>\\r\\n<p>La biblioteca del Campus de Ciencias Exactas e Ingenier\\u00eda ofrece m\\u00e1s de 48,568 vol\\u00famenes y en muchas ocasiones requiere mucho tiempo la b\\u00fasqueda de uno de \\u00e9stos. Una aplicaci\\u00f3n basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p style=\\\"text-align: justify;\\\">Con una colecci\\u00f3n de m\\u00e1s de 48,568 vol\\u00famenes en la biblioteca de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n, la tarea de buscar un libro puede requerir mucho tiempo y ser muy frustrante, especialmente para los alumnos que est\\u00e1n conociendo apenas las instalaciones. El sistema desarrollado implementa una aplicaci\\u00f3n basada en Realidad Aumentada (AR) que tiene como objetivo resolver el desconocimiento espacial de los usuarios en la biblioteca, al brindarnos un sistema de b\\u00fasqueda en estanter\\u00edas mediante Realidad Aumentada. Esta aplicaci\\u00f3n ayuda a los estudiantes y a los usuarios en general, al proporcionar una gu\\u00eda m\\u00f3vil con los servicios de informaci\\u00f3n de la biblioteca. En el art\\u00edculo escrito por el autor del sistema, se presentan los resultados de un estudio piloto que demuestran que las experiencias y el rendimiento del usuario en la biblioteca se mejoraron mediante el uso de tecnolog\\u00eda de realidad aumentada.<\\/p>\\r\\n<p>{gallery}Articulo_1_Cevera_Uribe{\\/gallery}<\\/p>\\r\\n<h4>Trabajo Ralizado<\\/h4>\\r\\n<p>{gallery}Articulo_4_Basto_Uno{\\/gallery}{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_1_Cevera_Uribe\\/cerverauribe2017.pdf{\\/aridoc}<\\/p>\",\"state\":1,\"catid\":\"11\",\"created\":\"2020-02-07 07:28:28\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 10:21:02\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 10:16:54\",\"publish_up\":\"2020-02-07 07:28:28\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/Articulo_1_Cevera_Uribe\\\\\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":18,\"ordering\":\"3\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"49\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(104, 7, 1, '', '2020-03-13 10:23:24', 136, 3430, 'e5f19ce2ca29d68c4f2acc99ff0688f1375db0cd', '{\"id\":7,\"asset_id\":\"80\",\"title\":\"Simulador de sistema operativo y lenguaje ensamblador\",\"alias\":\"simulador-de-sistema-operativo-y-lenguaje-ensamblador\",\"introtext\":\"<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador; adem\\u00e1s de otras herramientas de programaci\\u00f3n de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y m\\u00f3dulos para generar ejecutables a partir del lenguaje ensamblador, un m\\u00f3dulo para manejo de procesos, m\\u00f3dulo para manejo de memoria y una secci\\u00f3n para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambi\\u00e9n se puede emplear para hacer pr\\u00e1cticas para ayudar en la comprensi\\u00f3n de la arquitectura de las computadoras, el manejo de lenguaje m\\u00e1quina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gesti\\u00f3n.<\\/p>\\r\\n<p>{gallery}Articulo_3_Ayala{\\/gallery}<\\/p>\\r\\n<p>{gallery}Articulo_4_Basto_Uno{\\/gallery}{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_3_Ayala\\/IJCTT-V51P109.pdf{\\/aridoc}<\\/p>\",\"state\":1,\"catid\":\"9\",\"created\":\"2020-03-04 23:35:11\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 10:23:24\