(109, 7, 1, '', '2020-03-13 19:39:37', 136, 3422, '7f9870860a5f8dadaab2fff644a65a0e18b07311', '{\"id\":7,\"asset_id\":\"80\",\"title\":\"Simulador de sistema operativo y lenguaje ensamblador\",\"alias\":\"simulador-de-sistema-operativo-y-lenguaje-ensamblador\",\"introtext\":\"<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador; adem\\u00e1s de otras herramientas de programaci\\u00f3n de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y m\\u00f3dulos para generar ejecutables a partir del lenguaje ensamblador, un m\\u00f3dulo para manejo de procesos, m\\u00f3dulo para manejo de memoria y una secci\\u00f3n para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambi\\u00e9n se puede emplear para hacer pr\\u00e1cticas para ayudar en la comprensi\\u00f3n de la arquitectura de las computadoras, el manejo de lenguaje m\\u00e1quina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gesti\\u00f3n.<\\/p>\\r\\n<p>{gallery}Articulo_3_Ayala{\\/gallery}<\\/p>\\r\\n<h4>Trabajo Realizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_3_Ayala\\/IJCTT-V51P109.pdf{\\/aridoc}<\\/p>\",\"state\":1,\"catid\":\"9\",\"created\":\"2020-03-04 23:35:11\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 19:39:37\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 19:37:56\",\"publish_up\":\"2020-03-04 23:35:11\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulo_introduccion\\\\\\/Collage 2020-03-13 01_49_44.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":11,\"ordering\":\"2\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"49\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"