(146, 1, 1, '', '2020-03-21 06:29:46', 135, 4330, '378b903e68b674461d66d602daa66c13fabce0eb', '{\"id\":1,\"asset_id\":\"64\",\"title\":\"Historia de la facultad\",\"alias\":\"historia-de-la-facultad\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/uady_logo_amarillo.png\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>En el mes de septiembre de 1960 se celebr\\u00f3 en Yucat\\u00e1n el IV Congreso de la Sociedad Matem\\u00e1tica Mexicana, despu\\u00e9s del cual se reunieron maestros de Matem\\u00e1ticas y F\\u00edsica de la Escuela Preparatoria y de la Facultad de Ingenier\\u00eda de Universidad de Yucat\\u00e1n para elaborar un plan, cuyo objetivo ser\\u00eda la creaci\\u00f3n de un Departamento de Estudios F\\u00edsicos-Matem\\u00e1ticos para promover el inter\\u00e9s de estas ciencias y difundirlas, as\\u00ed como la preparaci\\u00f3n de los maestros encargados de impartirlas.<\\/p>\\r\\n<p>El acta de constituci\\u00f3n del departamento de Estudios F\\u00edsico-Matem\\u00e1ticos, as\\u00ed como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fu\\u00e9 hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoci\\u00f3 oficialmente, cambi\\u00e1ndole el nombre por Centro de Estudios F\\u00edsico-Matem\\u00e1ticos, el cual se inaugur\\u00f3 el 24 de septiembre de 1962.<\\/p>\\r\\n<p>Sus objetivos primordiales fueron \\\"promover la afici\\u00f3n y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., as\\u00ed como mejorar la ense\\u00f1anza principal mente de las Matem\\u00e1ticas, de acuerdo con las corrientes de la did\\u00e1ctica moderna\\\".<\\/p>\\r\\n<p>El centro de Estudios F\\u00edsico-Matem\\u00e1ticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique C\\u00e1rdenas P\\u00e9rez-Abreu, contaba con quince miembros.<\\/p>\\r\\n<p>La Escuela de Matem\\u00e1ticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucat\\u00e1n, Abog. Francisco Repetto Mil\\u00e1n, teniendo como antecedente el Centro de Estudios F\\u00edsico-Matem\\u00e1ticos. Comenz\\u00f3 a funcionar en salones del tercer piso del edificio central de la Universidad de Yucat\\u00e1n, en el cual permaneci\\u00f3 14 a\\u00f1os. Posteriormente se traslad\\u00f3 al local de la Facultad de Ingenier\\u00eda en los ex-terrenos del F\\u00e9nix donde permaneci\\u00f3 durante 9 a\\u00f1os, y en mayo de 1986 se reubic\\u00f3 sobre Circuito Colonias frente a la Unidad Habitacional Morelos.<\\/p>\\r\\n<p>Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matem\\u00e1ticas est\\u00e1n ubicadas en Anillo Perif\\u00e9rico Norte Km. 33.5 y forma parte del Campus de Ingenier\\u00eda y Ciencias Exactas de la Universidad Aut\\u00f3noma de Yucat\\u00e1n.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 03:45:57\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 06:29:46\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-03-21 06:28:54\",\"publish_up\":\"2020-02-07 03:45:57\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"1\\\",\\\"show_intro\\\":\\\"1\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"0\\\",\\\"show_category\\\":\\\"0\\\",\\\"link_category\\\":\\\"0\\\",\\\"show_parent_category\\\":\\\"0\\\",\\\"link_parent_category\\\":\\\"0\\\",\\\"show_associations\\\":\\\"0\\\",\\\"show_author\\\":\\\"0\\\",\\\"link_author\\\":\\\"0\\\",\\\"show_create_date\\\":\\\"0\\\",\\\"show_modify_date\\\":\\\"0\\\",\\\"show_publish_date\\\":\\\"0\\\",\\\"show_item_navigation\\\":\\\"0\\\",\\\"show_icons\\\":\\\"0\\\",\\\"show_print_icon\\\":\\\"0\\\",\\\"show_email_icon\\\":\\\"0\\\",\\\"show_vote\\\":\\\"0\\\",\\\"show_hits\\\":\\\"0\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"4\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"60\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
