(231, 36, 1, '', '2020-04-03 13:17:10', 136, 2850, '4e32dbf36dd2a993d1a27053bc592f773b4ca1bd', '{\"id\":36,\"asset_id\":\"117\",\"title\":\"Juego Maya MATYA\",\"alias\":\"juego-maya-matya\",\"introtext\":\"<p style=\\\"text-align: justify;\\\">Dise\\u00f1o e Implementaci\\u00f3n de un videojuego did\\u00e1ctico que apoya a estudiantes de primaria reforzando el estudio de la noci\\u00f3n de fracci\\u00f3n. Los escenarios son creados por herramientas de modelado en 2D, 3D.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p style=\\\"text-align: justify;\\\">Dise\\u00f1o e Implementaci\\u00f3n de un videojuego did\\u00e1ctico conformado de varias actividades, con el prop\\u00f3sito de que los estudiantes de primaria, en especial los educandos de sexto grado, refuercen el estudio de la noci\\u00f3n de fracci\\u00f3n. Este juego es creado considerando un avatar, cuya acci\\u00f3n de movimiento para el usuario es en tercera persona. Los escenarios son creados por herramientas de modelado en 2D, 3D y exportado a un formato que entienda el motor de juegos XNA.<\\/p>\\r\\n<p>{gallery}Articulo_8_MaderaBastoMATYA{\\/gallery}<video controls=\\\"controls\\\" width=\\\"100%\\\" height=\\\"100%\\\">\\r\\n  <source src=\\\"videos\\/videojuegoMusic.mp4\\\" type=\\\"video\\/mp4\\\" \\/>\\r\\nYour browser does not support the video tag.<\\/video><\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-04-03 12:56:44\",\"created_by\":\"136\",\"created_by_alias\":\"\",\"modified\":\"2020-04-03 13:17:10\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-04-03 13:16:41\",\"publish_up\":\"2020-04-03 12:56:44\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\