(285, 40, 1, '', '2020-04-09 16:12:18', 136, 3404, '0b89a418c918a458972d4e9ae9ee383378ed256a', '{\"id\":40,\"asset_id\":\"121\",\"title\":\"Simulador de sistema operativo y lenguaje ensamblador (4)\",\"alias\":\"quit-and-put\",\"introtext\":\"<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador; adem\\u00e1s de otras herramientas de programaci\\u00f3n de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y m\\u00f3dulos para generar ejecutables a partir del lenguaje ensamblador, un m\\u00f3dulo para manejo de procesos, m\\u00f3dulo para manejo de memoria y una secci\\u00f3n para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambi\\u00e9n se puede emplear para hacer pr\\u00e1cticas para ayudar en la comprensi\\u00f3n de la arquitectura de las computadoras, el manejo de lenguaje m\\u00e1quina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gesti\\u00f3n.<\\/p>\\r\\n<p>{gallery}Articulo_3_Ayala{\\/gallery}<\\/p>\\r\\n<h4>Trabajo Realizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_3_Ayala\\/IJCTT-V51P109.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-04-03 13:30:33\",\"created_by\":\"136\",\"created_by_alias\":\"\",\"modified\":\"2020-04-09 16:12:18\",\"modified_by\":